import React,{useState} from 'react'
import CourierOutIndex from './courierOut';
import CourierInvoiceIndex from './invoice';
import CourierSubIndex from './subIndex';



export default function CourierIndex() {
    const challanType = new URLSearchParams(window.location.search).get("type");
    const [index, setindex] = useState(0)
    // const history = useHistory();
    // console.log(challanType);

    return (
        <div className="card card-custom gutter-b  px-7 py-3">
            <ul className="nav nav-tabs nav-tabs-line">
                <li className="nav-item">
                    <a
                        className={
                            `nav-link ` +
                            (index === 0
                                ? "active"
                                : "")
                        }
                        onClick={() => {
                            // window.location.href = `/logistics/delivery-challan?type=${encodeURIComponent(
                            //   "SL" 
                            // )}`;
                            setindex(0)
                        }}
                    >
                        In
                    </a>
                </li>
                <li className="nav-item">
                    <a
                        className={
                            `nav-link ` +
                            (index === 1 ? "active" : "")
                        }
                        onClick={() =>
                            // (window.location.href = `/logistics/delivery-challan?type=${encodeURIComponent(
                            //   "Non SL"
                            // )}`)
                            setindex(1)
                        }
                    >
                        Out
                    </a>
                </li>
                <li className="nav-item">
                    <a
                        className={
                            `nav-link ` +
                            (index === 2 ? "active" : "")
                        }
                        onClick={() =>
                            // (window.location.href = `/logistics/delivery-challan?type=${encodeURIComponent(
                            //   "MDC"
                            // )}`)
                            setindex(2)
                        }
                    >
                        Invoice
                    </a>
                </li>
               
            </ul>
            <div className="tab-content">
                {/* {(index === 0 || index === 1) && <ChallanIndex
                    type={challanType ? decodeURIComponent(challanType) : "SL"}
                />} */}
                {
                 index===0&& <CourierSubIndex/>
                }
                {
                 index===1&& <CourierOutIndex/>
                }
                {
                 index===2&& <CourierInvoiceIndex/>
                }
                {/* {index === 2 && <ChallanIndexMdc />} */}
                {/* {(index === 3 || index === 4) && <ChallanIndexSlWip />} */}
            </div>
        </div>
    );
};
